public static MultipartUploader get(FileSystem fs, Configuration conf)
    throws IOException {
  MultipartUploader mpu = null;
  for (MultipartUploaderFactory factory : serviceLoader) {
    mpu = factory.createMultipartUploader(fs, conf);
    if (mpu != null) {
      break;
    }
  }
  return mpu;
}
